"          MELDScore = 10 * ((0.957 * ln(Creatinine)) + (0.378 * ln(Bilirubin)) + (1.12 * ln(INR))) + 6.43",
"         </span>",
"        </td>",
"       </tr>",
"       <tr>",
"        <td align=\"left\" bgcolor=\"#6c9a9c\">",
"         <span class=\"medCalcFontFormuli\">",
"          MELDNaScore = MELDScore - SerumNa - (0.025 * MELDScore * (140 - SerumNa)) + 140",
"         </span>",
"        </td>",
"       </tr>",
"      </table>",
"      <br/>",
"      &nbsp;",
"      <br/>",
"     </div>",
"    </center>",
