"     <span class=\"medCalcFontOne\">",
"     </span>",
"    </div>",
"    <div id=\"calc_notes\">",
"     <span class=\"medCalcFontOneBold\">",
"      Notes",
"     </span>",
"     <ul class=\"medCalcFontOne\">",
"      <li>",
"       The Model of End-stage Liver Disease, or",
"       <b>",
"        MELD Score",
"       </b>",
"       is used to estimate relative disease severity and likely survival of patients awaiting liver transplantation.",
"      </li>",
"      <li>",
"       The MELDNa score system adds a",
"       <b>",
"        Serum Na",
"       </b>",
"       parameter, so the added risk of significant hyponatremia may be taken into account.",
"      </li>",
"      <li>",
"       Children under the age of 12 should be assessed by the",
"       <b>",
"        PELD Score",
"       </b>",
"       .",
"      </li>",
"      <li>",
"       If a patient has had 2 or more hemodialysis treatments or 24 hours of CVVHD in the week prior to the time of the scoring,",
"       <b>",
"        Creatinine",
"       </b>",
"       will be set to 4 mg/dL, the maximum creatinine level allowed in the model.",
"      </li>",
"      <li>",
"       For patients with hepatocellular carcinoma, the PELD/MELD score is increased according to an algorithm established by UNOS (United Network for Organ Sharing.)",
"      </li>",
"      <li>",
"       Additional information about the",
"       <b>",
"        MELD",
"       </b>",
"       and",
"       <b>",
"        PELD",
"       </b>",
"       scores is at the UNOS website, file://optn.transplant.hrsa.gov/resources/",
"       <wbr>",
"       </wbr>",
"       professionalResources.asp?index=8",
"      </li>",
"      <li>",
"       Please see appropriate UpToDate topic reviews for further information.",
"      </li>",
"     </ul>",
"    </div>",
"    <br/>",
"    &nbsp;",
"    <br/>",
"    <div id=\"calc_refs\">",
"     <span class=\"medCalcFontRef\">",
"      <b>",
