"        Kim WR, Biggins SW, Kremers WK, Wiesner RH, et. al. Hyponatremia and mortality among patients on the liver-transplant  waiting list.",
"        <i>",
"         N Engl J Med",
"        </i>",
"        . 2008 Sep 4;359(10):1018-26.",
"       </span>",
"      </li>",
