var script_f14_39_14962=[" ",
"",
"",
"function log(i){",
"return Math.log(i) * Math.LOG10E;   ",
"}",
"",
"function ln(i){",
"return Math.log(i);",
"}",
"",
"function sq(i){",
"return i * i;",
"}",
"",
"function sqr(i){",
"return Math.sqrt(i);",
"}",
"",
"",
"function power(x,y){",
"return Math.pow(x,y);",
"}",
"",
"function eTo(x){",
"return Math.exp(x);",
"}",
"",
"",
"function fixDP(r, dps) {",
"if (isNaN(r)) return \"NaN\";",
"var msign = '';",
"if (r < 0) msign = '-';",
"x = Math.abs(r);",
"if (x > Math.pow(10, 21)) return msign + x.toString();",
"var m = Math.round(x * Math.pow(10, dps)).toString();",
"if (dps == 0) return msign + m;",
"while (m.length <= dps) m = \"0\" + m;",
"return msign + m.substring(0, m.length - dps) + \".\" + m.substring(m.length - dps);",
"}",
"",
"var currenttimeout;",
"",
"",
"var calctxt = ''; ",
"var xmltxt = ''; ",
"var htmtxt = ''; ",
"",
"",
"",
"function MELDNa_fx() {",
"",
"currenttimeout = self.setTimeout('minMaxCheck();', 3000);",
"",
"with(document.MELDNa_form){",
"",
"",
"doCalc = true;",
"if (Creatinine_param.value.indexOf(',') >= 0){ Creatinine_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Creatinine_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Creatinine_unit.options[Creatinine_unit.selectedIndex].value.split('|');",
"Creatinine = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"if (Bilirubin_param.value.indexOf(',') >= 0){ Bilirubin_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Bilirubin_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Bilirubin_unit.options[Bilirubin_unit.selectedIndex].value.split('|');",
"Bilirubin = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"if (INR_param.value.indexOf(',') >= 0){ INR_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(INR_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"INR = param_value;",
"if (Serum_Na_param.value.indexOf(',') >= 0){ Serum_Na_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Serum_Na_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Serum_Na_unit.options[Serum_Na_unit.selectedIndex].value.split('|');",
"Serum_Na = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"dp = 0;",
"if (Hemodialysis_twice_in_week_prior_radio[0].checked){",
"Creatinine_param.value = '4'; Creatinine = 4;",
"for(i = 0; i < Creatinine_unit.options.length; i++){",
"if (Creatinine_unit.options[i].value == '1|0|mg/dL') Creatinine_unit.selectedIndex = i;",
"}}",
"MELD_Score =  10 * ((0.957 * ln(Creatinine)) + (0.378 * ln(Bilirubin)) + (1.12 * ln(INR))) + 6.43;",
"",
"if (doCalc) MELD_Score_param.value = fixDP(MELD_Score, dp);",
"",
"",
"",
"MELDNa_Score =  MELD_Score - Serum_Na - (0.025 * MELD_Score * (140 - Serum_Na)) + 140;",
"",
"if (doCalc) MELDNa_Score_param.value = fixDP(MELDNa_Score, dp);",
"",
"",
"",
"",
"",
"}",
"",
"}",
"",
"function minMaxCheck(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.MELDNa_form){",
"",
"if (Creatinine_param.value && Creatinine < 1) {",
"Creatinine = 0;",
"Creatinine_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Creatinine is 1 mg/dL.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Creatinine_param.value && Creatinine > 4) {",
"Creatinine_param.value = \"\";",
"clrResults();",
"Creatinine = 0;",
"doCalc = false;",
"alert(\"The maximum value for Creatinine is 4 mg/dL.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Bilirubin_param.value && Bilirubin < 1) {",
"Bilirubin = 0;",
"Bilirubin_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Bilirubin is 1 mg/dL.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Bilirubin_param.value && Bilirubin > 200) {",
"Bilirubin_param.value = \"\";",
"clrResults();",
"Bilirubin = 0;",
"doCalc = false;",
"alert(\"The maximum value for Bilirubin is 200 mg/dL.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (INR_param.value && INR < 1) {",
"INR = 0;",
"INR_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for INR is 1 .\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (INR_param.value && INR > 100) {",
"INR_param.value = \"\";",
"clrResults();",
"INR = 0;",
"doCalc = false;",
"alert(\"The maximum value for INR is 100 .\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Serum_Na_param.value && Serum_Na < 125) {",
"Serum_Na = 0;",
"Serum_Na_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Serum Na is 125 mmol/L.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Serum_Na_param.value && Serum_Na > 140) {",
"Serum_Na_param.value = \"\";",
"clrResults();",
"Serum_Na = 0;",
"doCalc = false;",
"alert(\"The maximum value for Serum Na is 140 mmol/L.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"",
"",
"}",
"",
"}",
"",
"",
"function clrResults(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.MELDNa_form){",
"",
"MELD_Score_param.value = '';",
"MELDNa_Score_param.value = '';",
"",
"",
"}",
"",
"}",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
""].join("\n");
