var title_f14_39_14967="Gene exp array meth";
var content_f14_39_14967=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F82165&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F82165&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 629px\">",
"   <div class=\"ttl\">",
"    Gene expression array methodology",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 609px; height: 417px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    One approach to gene expression profiling is illustrated here. A) RNA from a tumor and reference sample is processed, fluorescently labeled, and hybridized to a microscope-sized chip, to which probes for thousands of genes have been affixed. B) The red (relative overexpression in tumor) and green (relative underexpression in tumor) intensities can be analyzed simultaneously. C) Depending on the supervision of the analysis, tumors can be subtyped (as shown here), or can be analyzed for gene sets associated with clinical outcome.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
