var title_f14_39_14968="Fascioliasis life cycle";
var content_f14_39_14968=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F50779&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F50779&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 608px\">",
"   <div class=\"ttl\">",
"    Fascioliasis life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 588px; height: 477px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Immature eggs are discharged in the biliary ducts and in the stool",
"    <strong>",
"     (1)",
"    </strong>",
"    . Eggs become embryonated in water",
"    <strong>",
"     (2)",
"    </strong>",
"    , eggs release miracidia",
"    <strong>",
"     (3)",
"    </strong>",
"    , which invade a suitable snail intermediate host",
"    <strong>",
"     (4)",
"    </strong>",
"    , including the genera",
"    <em>",
"     Galba",
"    </em>",
"    ,",
"    <em>",
"     Fossaria",
"    </em>",
"    , and",
"    <em>",
"     Pseudosuccinea",
"    </em>",
"    . In the snail, the parasites undergo several developmental stages (sporocysts",
"    <strong>",
"     (4a)",
"    </strong>",
"    , rediae",
"    <strong>",
"     (4b)",
"    </strong>",
"    , and cercariae",
"    <strong>",
"     (4c)",
"    </strong>",
"    ). The cercariae are released from the snail",
"    <strong>",
"     (5)",
"    </strong>",
"    and encyst as metacercariae on aquatic vegetation or other surfaces. Mammals acquire the infection by eating vegetation containing metacercariae. Humans can become infected by ingesting metacercariae-containing freshwater plants, especially watercress",
"    <strong>",
"     (6)",
"    </strong>",
"    . After ingestion, the metacercariae excyst in the duodenum",
"    <strong>",
"     (7)",
"    </strong>",
"    and migrate through the intestinal wall, the peritoneal cavity, and the liver parenchyma into the biliary ducts, where they develop into adults",
"    <strong>",
"     (8)",
"    </strong>",
"    . In humans, maturation from metacercariae into adult flukes takes approximately three to four months. The adult flukes (",
"    <em>",
"     Fasciola hepatica",
"    </em>",
"    : up to 30 mm by 13 mm;",
"    <em>",
"     F. gigantica",
"    </em>",
"    : up to 75 mm) reside in the large biliary ducts of the mammalian host.",
"    <em>",
"     Fasciola hepatica",
"    </em>",
"    infect various animal species, mostly herbivores.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Fascioliasis. Available at:",
"     <a href=\"file://www.dpd.cdc.gov/dpdx/html/fascioliasis.htm\" target=\"_blank\">",
"      file://www.dpd.cdc.gov/dpdx/html/fascioliasis.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
