var title_f14_39_14969="AVNRT via Mahaim pathway";
var content_f14_39_14969=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F58895&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F58895&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 561px\">",
"   <div class=\"ttl\">",
"    AVNRT via Mahaim pathway",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 541px; height: 304px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The QRS complexes in this extremely rapid (approximately 450 beats/min) and regular tachycardia are widened or aberrant. The mechanisms for the arrhythmia include an atrioventricular nodal reentrant tachycardia with aberration or an antidromic atrioventricular reentrant tachycardia (AVRT) in a patient with the Wolff-Parkinson-White syndrome and antegrade conduction to the ventricle via a Kent pathway. At electrophysiologic testing, the etiology was determined to be an AVNRT with antegrade conduction to ventricle via an atriofascicular (Mahaim) accessory pathway.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
